import axios from "axios";
import { AllMOVIES, MOVIESAPI } from "../types/moviesTypes";

export const getAllMoviesAction = () => {
  const res = axios.get(MOVIESAPI);
  console.log(res);
  return {
    type: AllMOVIES,
    data: res.data.results,
    pages: res.data.total_pages,
  };
};
